# list -> array, mengakses dengan mengunakan index

data_list = ["bambang","budi","riko"]

print(data_list[1])

# dictionary (dict) -> associative array
# identifier -> key

data_dict = {
    'key' : 'velue',
    'ms' : 'mansur',
    'bst' : 'bastian',
    'nmr' : 111,
    'list' : data_list
}

print(data_dict["nmr"])
print(data_dict['list'])